import Layout from './components/GeneralLayout';
import Navigation from './components/Navigation';
import Album from './components/Album';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import Link from 'next/link';

function multPrint ()
{
    var cards = ["viaje1", "viaje2", "viaje3", "viaje4", "viaje5"];
    return cards.map(card => ( //change this
        <div className="card mb-3 col-lg-3 col-12 mx-auto" >
            <div className="no-gutters" >
                <div className="col-md-8 col-10">
                    <div className="card-body p-3">
                        <h5 className="card-title">
                            {card}
                        </h5>
                        <p className="card-text">
                            {card}
                        </p>
                        <Link href="/pAlbum/[album]" as={`/pAlbum/${cards}`}>
                            <Button className="btn-sm float-right mb-3" variant="dark">
                                Ver más
                            </Button>
                        </Link>
                    </div>
                </div>
            </div>
        </div>
    ));
}

export default function galeria ()
{
    return (
        <div>
            <Navigation />
            <Layout>
                <div className="row justify-content-center">
                    <h1 className="mt-2 mb-4">
                        Galería
                    </h1>
                </div>
                <div className="row col-6 mx-auto">
                    {multPrint()}
                </div>
            </Layout>
        </div>
    )
}
